import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import DepartmentPage from './pages/DepartmentPage';  // Import the page
import Navbar from './components/Navbar'; // Example Navbar component

const App = () => {
  return (
    <Router>
      <Navbar />  {/* If you have a Navbar */}
      <Routes>  {/* Use Routes here instead of Switch */}
        <Route path="/departments" element={<DepartmentPage />} />
        {/* Add other routes */}
      </Routes>
    </Router>
  );
};

export default App;
